import React from "react";
import ReactDOM from "react-dom";
import htmlImage from "./html.png";
import cssImage from "./css.png";
import jslImage from "./js.png";
import reactImage from "./react.png";

const header = (
  <header>
    <div className="header-wrapper">
      <h2> front End Technologies</h2>
    </div>
  </header>
);
const user = (
  <div>
    <img src={htmlImage} alt="html image" height="1rem" />
    <img src={cssImage} alt="css image" height="1rem" />
    <img src={jslImage} alt="js image" height="1rem" />
    <img src={reactImage} alt="react image" height="1rem" />
  </div>
);

const rootElement = document.getElementById("root");
ReactDOM.render(user, rootElement);
